import { takeLatest } from 'redux-saga/effects';
import axios from 'axios';

function* searchPeople(action) {
    console.log('SEARCH PEOPLE');
}

function* peopleSaga() {
    yield takeLatest('FETCH_PEOPLE', searchPeople);
  }

  export default peopleSaga;
